import React from 'react';

const Movie = (props) => (
    <div className="card-container">
    <div className="image-container">
        <img src={props.movie.Poster} alt={props.movie.Title} />

    </div>
    <div className="movie-details">
        <p>{props.movie.Title}</p> 

    </div> 

</div>
)

export default Movie;
